import React from "react";
import "./demo.css"; // Import the CSS file for styling
import Cial from "../assets/png/project_1.png";
const projects = [
  {
    id: 1,
    title: "Cial",
    description: "Description of Project One",
    image: Cial, // Replace with your image URL
  },
  {
    id: 2,
    title: "Project Two",
    description: "Description of Project Two",
    image: "https://via.placeholder.com/300",
  },
  {
    id: 3,
    title: "Project Three",
    description: "Description of Project Three",
    image: "https://via.placeholder.com/300",
  },
  {
    id: 4,
    title: "Project Four",
    description: "Description of Project Four",
    image: "https://via.placeholder.com/300",
  },
  // Add more projects as needed
];

const Portfolio = () => {
  return (
    <section class="project-details">
      <div class="main-container">
        <div class="project-details__content_1">
          <div className="portfolio">
            <h1>My Projects</h1>
            <div className="grid">
              {projects.map((project) => (
                <div className="grid-item" key={project.id}>
                  <img src={project.image} alt={project.title} />
                  <h2>{project.title}</h2>
                  <p>{project.description}</p>
                  <button className="grid-button">
                    <Link
                      to={item.link}
                      class="btn btn--med_1 btn--theme dynamicBgClr"
                      // target="_blank"
                    >
                      {item.link_label}
                    </Link>
                  </button>
                </div>
              ))}
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Portfolio;
